import React from "react";
import {
  MessageContainer,
  MessageWrapper,
  MessageColumn,
  Avatar,
} from "./MsElements";

const Messages = () => {
  return (
    <>
      <MessageContainer>
        <MessageWrapper>
          <Avatar></Avatar>
          <MessageColumn>
            <Title></Title>
            <Body></Body>
          </MessageColumn>
        </MessageWrapper>
      </MessageContainer>
    </>
  );
};

export default Messages;
